import {
    GET_PROD_BY_SOLD,
    GET_PROD_BY_DATE
} from '../types';

export const productsBySold = (data) => {

    return {
        type: GET_PROD_BY_SOLD,
        payload: data
    }

}

export const productsByDate = (data) => {

    return {
        type: GET_PROD_BY_DATE,
        payload: data
    }

}
